        .snowflake {
            --size: 1vw;
            width: var(--size);
            height: var(--size);
            background: white;
            border-radius: 50%;
            position: absolute;
            top: -5vh;
        }

        @keyframes snowfall {
            0% {
                transform: translate3d(var(--left-ini), 0, 0);
            }

                transform: translate3d(var(--left-end), 110vh, 0);
            }
        }

        /***/
        #youtube {
            z-index: 2;
            display: block;
            width: 100px;
            height: 70px;
            position: absolute;
            bottom: 20px;
            right: 20px;
            background: red;
            border-radius: 50%/11%;
            transition: transform 0.5s;
        }

        #youtube:hover,
        #youtube:focus {
            transform: scale(1.1);
        }

        #youtube::before {
            content: "";
            display: block;
            position: absolute;
            top: 7.5%;
            left: -6%;
            width: 112%;
            height: 85%;
            background: red;
            border-radius: 9%/50%;
        }

        #youtube::after {
            content: "";
            display: block;
            position: absolute;
            top: 20px;
            left: 40px;
            width: 45px;
            height: 30px;
            border: 15px solid transparent;
            box-sizing: border-box;
            border-left: 30px solid white;
        }

        #youtube span {
            font-size: 0;
            position: absolute;
            width: 0;
            height: 0;
            overflow: hidden;
        }


        #sheets-viewport {
            overflow: auto;
        }

        #sheets-viewport.widget-viewport {
            overflow: hidden;
        }

        .grid-container {
            overflow: visible;
            background: white;
        }

        .grid-table-container {
            overflow: visible;
        }

        #top-bar {
            margin: 0;
            overflow: hidden;
        }

        #top-bar {
            border-bottom: 1px solid #ccc;
            padding: 6px 6px 0;
        }

        #doc-title {
            padding-bottom: 5px;
        }

        #doc-title .name {
            font-size: 15px;
        }

        #sheet-menu {
            font-size: 13px;
            margin: 6px 0 0;
            padding: 0 0 5px;
        }

        #sheet-menu li {
            display: inline;
            list-style-type: none;
            margin: 0;
            padding: 5px 8px;
        }

        #sheet-menu li.active {
            background-color: #fff;
            font-weight: bold;
            border: 1px solid #999;
        }

        #top-bar #sheet-menu li.active {
            border-bottom: 0;
        }

        #sheet-menu a,
        #sheet-menu a:visited {
            color: #07c;
        }

        #footer {
            background: #f0f0f0;
            border-top: 1px #ccc solid;
            border-bottom: 1px #ccc solid;
            font-size: 13;
            padding: 10px 10px;
        }

        .dash {
            padding: 0 6px;
        }
